import React, { useState } from 'react'
import '../App.css';

const Buses = ({busData}) => {


 const [buses, setBuses] = useState(busData)

 const printData=()=>{
  console.log(buses)
 }
  return (
    <div>
     <div className='p-3'></div>
     <div className='container'>
      <h2 className='text-danger'>Available Buses</h2>
      <div className='side-by-side'>
      {
       buses.map(
              bus => (
                  <tr key={bus.id}>
                   <div className='side-by-side'>
                    <p className='text-danger'> { bus.busId } </p>
                   </div>
                   <div className='text-danger'>
                    <p className='text-da'> { bus.busName } </p>
                   </div>
                   <div className='side-by-side'>
                    <p className='side-by-side'> { bus.startTime } </p>
                   </div>
                  </tr>
              )
       )
      }
      </div>
     </div>
     
    </div>
  )
}

export default Buses
